import React from 'react';
import { motion } from 'framer-motion';
import AnimatedBackground from '../components/AnimatedBackground';

const AllProjects = ({ onBack }) => {
  const figmaProjects = [
    {
      id: 'fig-1',
      title: 'Fintech Wallet UI',
      category: 'Figma',
      description:
        'A secure wallet experience with biometric authentication, smart budgeting, and intuitive analytics.',
      tags: ['Product', 'Mobile', 'Design System'],
    },
    {
      id: 'fig-2',
      title: 'Healthcare Portal',
      category: 'Figma',
      description:
        'Patient-first healthcare portal featuring appointment booking, record viewing, and responsive dashboards.',
      tags: ['Responsive', 'Accessibility', 'Web'],
    },
    {
      id: 'fig-3',
      title: 'Creative SaaS Dashboard',
      category: 'Figma',
      description:
        'Data-rich dashboard with modular widgets, advanced filters, and a cohesive visual language.',
      tags: ['Dashboard', 'Components', 'Data Viz'],
    },
  ];

  const wordpressProjects = [
    {
      id: 'wp-1',
      title: 'Boutique Agency Site',
      category: 'WordPress',
      description:
        'High-impact agency website with smooth scrolling, case-study highlights, and conversion-focused CTAs.',
      tags: ['Elementor', 'Animations', 'SEO'],
    },
    {
      id: 'wp-2',
      title: 'Luxury Hotel Booking',
      category: 'WordPress',
      description:
        'Hospitality experience with room showcases, booking calendar, and localized multi-language support.',
      tags: ['Booking', 'Performance', 'i18n'],
    },
    {
      id: 'wp-3',
      title: 'Portfolio & Blog Hub',
      category: 'WordPress',
      description:
        'Personal brand hub blending long-form storytelling, project galleries, and newsletter capture.',
      tags: ['Gutenberg', 'Email Capture', 'Content'],
    },
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: { staggerChildren: 0.12, delayChildren: 0.15 },
    },
  };

  const cardVariants = {
    hidden: { opacity: 0, y: 60, scale: 0.95 },
    visible: {
      opacity: 1,
      y: 0,
      scale: 1,
      transition: { duration: 0.8, ease: [0.6, -0.05, 0.01, 0.99] },
    },
  };

  const sectionTitleVariants = {
    hidden: { opacity: 0, y: 40 },
    visible: {
      opacity: 1,
      y: 0,
      transition: { duration: 0.8, ease: [0.6, -0.05, 0.01, 0.99] },
    },
  };

  const renderGrid = (items) => (
    <motion.div
      variants={containerVariants}
      initial="hidden"
      whileInView="visible"
      viewport={{ once: true, amount: 0.2 }}
      className="grid md:grid-cols-2 lg:grid-cols-3 gap-6 lg:gap-8"
    >
      {items.map((project) => (
        <motion.div
          key={project.id}
          variants={cardVariants}
          className="group relative bg-white/5 rounded-3xl overflow-hidden border border-white/10 backdrop-blur-xl"
          whileHover={{
            y: -18,
            scale: 1.02,
            borderColor: 'rgba(255, 255, 255, 0.4)',
            backgroundColor: 'rgba(255, 255, 255, 0.08)',
          }}
          transition={{ type: 'spring', stiffness: 320, damping: 28 }}
        >
          <div className="relative h-60 bg-gradient-to-br from-white/10 via-white/5 to-transparent overflow-hidden">
            <div className="absolute inset-0 bg-[linear-gradient(45deg,transparent_25%,rgba(255,255,255,0.05)_25%,rgba(255,255,255,0.05)_50%,transparent_50%,transparent_75%,rgba(255,255,255,0.05)_75%,rgba(255,255,255,0.05))] bg-[size:20px_20px]" />
            <motion.div
              className="absolute inset-0 flex items-center justify-center"
              animate={{
                scale: [1, 1.08, 1],
                rotate: [0, 6, 0],
              }}
              transition={{ duration: 3.5, repeat: Infinity, ease: 'easeInOut' }}
            >
              <span className="text-5xl opacity-20">✨</span>
            </motion.div>
            <motion.div
              className="absolute top-4 right-4"
              whileHover={{ scale: 1.08 }}
            >
              <span className="px-3 py-1 text-xs font-medium bg-black/70 text-white rounded-full backdrop-blur-sm border border-white/20">
                {project.category}
              </span>
            </motion.div>
            <motion.div
              className="absolute inset-0 bg-gradient-to-r from-transparent via-white/10 to-transparent"
              initial={{ x: '-110%' }}
              whileHover={{ x: '110%' }}
              transition={{ duration: 0.9 }}
            />
          </div>

          <div className="p-6 sm:p-8 relative z-10">
            <div className="flex items-start justify-between mb-3">
              <motion.h3
                className="text-xl sm:text-2xl font-extralight text-white tracking-wide flex-1"
                whileHover={{ x: 6, letterSpacing: '0.02em' }}
                transition={{ duration: 0.25 }}
              >
                {project.title}
              </motion.h3>
              <motion.div
                className="ml-4 text-white/30 group-hover:text-white/90 transition-all text-2xl"
                whileHover={{ rotate: 40, scale: 1.25 }}
                transition={{ duration: 0.25 }}
              >
                →
              </motion.div>
            </div>
            <p className="text-white/50 mb-6 text-sm sm:text-base leading-[1.7] font-extralight tracking-wide">
              {project.description}
            </p>
            <div className="flex flex-wrap gap-2">
              {project.tags.map((tag) => (
                <motion.span
                  key={tag}
                  className="px-3 py-1.5 text-xs font-light bg-white/10 text-white/80 rounded-full border border-white/10 tracking-wide"
                  whileHover={{
                    scale: 1.12,
                    backgroundColor: 'rgba(255, 255, 255, 0.2)',
                    borderColor: 'rgba(255, 255, 255, 0.3)',
                    y: -1,
                  }}
                  transition={{ duration: 0.18 }}
                >
                  {tag}
                </motion.span>
              ))}
            </div>
          </div>
        </motion.div>
      ))}
    </motion.div>
  );

  return (
    <section className="relative py-20 md:py-28 px-4 sm:px-6 lg:px-8 bg-black overflow-hidden">
      <motion.div
        className="absolute inset-0 bg-[linear-gradient(rgba(255,255,255,0.02)_1px,transparent_1px),linear-gradient(90deg,rgba(255,255,255,0.02)_1px,transparent_1px)] bg-[size:50px_50px]"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 0.8 }}
      />
      <AnimatedBackground variant="projects" />

      <div className="max-w-7xl mx-auto relative z-10">
        <div className="flex flex-col md:flex-row md:items-center md:justify-between gap-6 mb-14">
          <motion.div
            initial={{ opacity: 0, y: 40 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.9, ease: [0.6, -0.05, 0.01, 0.99] }}
          >
            <p className="text-xs font-extralight text-white/40 uppercase tracking-[0.3em] mb-4">
              Portfolio
            </p>
            <h1 className="text-4xl sm:text-5xl md:text-6xl font-extralight text-white leading-tight tracking-[-0.02em]">
              All Projects
              <span className="block bg-gradient-to-r from-white via-white/90 to-white/70 bg-clip-text text-transparent font-extralight">
                Figma & WordPress
              </span>
            </h1>
            <p className="text-white/55 mt-4 max-w-2xl font-extralight tracking-wide">
              Every design and build collected in one place. Explore dedicated
              Figma prototypes and WordPress deliveries without losing the
              crafted aesthetic from the main experience.
            </p>
          </motion.div>

          {onBack && (
            <motion.button
              onClick={onBack}
